B.FO=new A.b1(B.Gj,["Strona g\u0142\xf3wna","Umiej\u0119tno\u015bci","Projekty","Mateusz Pietrzak","In\u017cynier elektronik oraz doktorant specjalizuj\u0105cy si\u0119 w\xa0systemach embedded - od projektowania PCB, przez implementacj\u0119 firmware, po testy laboratoryjne i\xa0terenowe. Zajmuj\u0119 si\u0119 projektowaniem uk\u0142ad\xf3w pomiarowych, programowaniem mikrokontroler\xf3w (STM32, AVR) oraz przetwarzaniem sygna\u0142\xf3w. Posiadam do\u015bwiadczenie w\xa0monta\u017cu i\xa0testach prototyp\xf3w oraz we\xa0wdro\u017ceniach rozproszonych sieci czujnik\xf3w w\xa0mi\u0119dzynarodowych o\u015brodkach badawczych. Interesuj\u0105 mnie projekty \u0142\u0105cz\u0105ce projektowanie sprz\u0119tu i\xa0oprogramowania systemowego.","Umiej\u0119tno\u015bci","Moje projekty","Zobacz szczeg\xf3\u0142y","Projekty zespo\u0142owe","Wykorzystane technologie: ","\u2709 Napisz do mnie","Powr\xf3t","Kopiuj e-mail","Adres e-mail zosta\u0142 skopiowany!","Zobacz kod na GitHubie","Stworzone przez: Mateusz \u2014 zbudowane z "," Flutter 3.38.4\n\xa9 2025 \u2022 Projekt open-source (MIT)","Programowanie","Mikrokontrolery i systemy wbudowane","Komputery jednop\u0142ytkowe","Projektowanie PCB i symulacja obwod\xf3w","Prototypowanie i monta\u017c","Aparatura pomiarowa","Inne","C","C++","Python","MATLAB","LabVIEW","bash","VHDL","Git","STM32","AVR","ESP32","Raspberry Pi","Altium Designer","CircuitStudio","PADS","LTspice","Monta\u017c PCB","Lutowanie SMD/THT","Druk 3D","Oscyloskop","Multimetr","Zasilacze","Analizatory logiczne","Licznik cz\u0119stotliwo\u015bci","Generator sygna\u0142\xf3w arbitralnych","LaTeX","Wielowi\u0105zkowy Radar Ultrad\u017awi\u0119kowy","Ultrad\u017awi\u0119kowy system lokalizacji obiekt\xf3w wykorzystuj\u0105cy technik\u0119 monoimpulsow\u0105.","Prototyp radaru ultrad\u017awi\u0119kowego podczas test\xf3w zasi\u0119gu (obiekt w tle: balon \xd880 cm na dystansie ~12 m)","Test wykrywania wielu cel\xf3w - jednoczesny pomiar odleg\u0142o\u015bci i azymut dw\xf3ch obiekt\xf3w","Kompletny system: przetworniki ultrad\u017awi\u0119kowe, elektronika pomiarowa, mikrokontroler STM32","Ultrad\u017awi\u0119kowy system lokalizacji obiekt\xf3w wykorzystuj\u0105cy technik\u0119 monoimpulsow\u0105\n\nRadar wykrywa obiekty w zakresie 0,5-15\xa0m z\xa0rozdzielczo\u015bci\u0105 k\u0105tow\u0105 1-8\xb0 i\xa0dok\u0142adno\u015bci\u0105 odleg\u0142o\u015bci ~1\xa0cm.\n\nPROBLEM\nAutonomiczne pojazdy i\xa0systemy bezpiecze\u0144stwa wymagaj\u0105 tanich, dok\u0142adnych czujnik\xf3w do wykrywania przeszk\xf3d. Tradycyjne sonary ultrad\u017awi\u0119kowe nie okre\u015blaj\u0105 kierunku obiektu, a\xa0radary elektromagnetyczne s\u0105 drogie. Potrzebne by\u0142o rozwi\u0105zanie \u0142\u0105cz\u0105ce niski koszt z\xa0mo\u017cliwo\u015bci\u0105 lokalizacji (odleg\u0142o\u015b\u0107 + kierunek).\n\nROZWI\u0104ZANIE\nZaprojektowa\u0142em radar wykorzystuj\u0105cy trzy przetworniki piezoelektryczne (40\xa0kHz) w\xa0konfiguracji monoimpulsowej. Zbudowa\u0142em kompletny tor analogowy: nadajnik z\xa0mostkiem\xa0H (40\xa0V), demodulatory IQ z\xa0mieszaczami AD633, filtry Sallen-Key oraz system cyfrowy na STM32F411. Synchronizacja przez sprz\u0119\u017cone liczniki zapewni\u0142a stabilno\u015b\u0107 fazy. Opracowa\u0142em algorytm wyznaczania pozycji na podstawie sygna\u0142u \u0394/\u03a3 z\xa0funkcj\u0105 pelengacyjn\u0105. Projekt umo\u017cliwia jednoczesne oszacowanie odleg\u0142o\u015bci i\xa0kierunku przy u\u017cyciu niedrogiego sprz\u0119tu ultrad\u017awi\u0119kowego.\n\nREZULTATY\nOsi\u0105gni\u0119to zasi\u0119g 15\xa0m dla obiekt\xf3w sferycznych (balon o\xa0\u015br.\xa080\xa0cm), rozdzielczo\u015b\u0107 azymutaln\u0105 1\xb0\xa0(obiekty bliskie) i\xa08\xb0 (dalekie), pr\xf3bkowanie 200 kHz. Opracowano prototyp systemu gotowy do integracji z\xa0pojazdami autonomicznymi.\n\nMoja rola: pe\u0142na realizacja projektu w\xa0zakresie hardware i\xa0software.\n\nLink:\nhttps://apd.usos.pw.edu.pl/diplomas/46829/?_s=1\n\n  ","Anemometr Ultrad\u017awi\u0119kowy","Dwuosiowy ultrad\u017awi\u0119kowy czujnik pr\u0119dko\u015bci i kierunku wiatru z pomiarem przesuni\u0119cia fazowego oraz rejestracj\u0105 danych.","Kalibracja w tunelu aerodynamicznym - por\xf3wnanie z anemometrem mechanicznym stacji pogodowej","Dwuosiowa konfiguracja przetwornik\xf3w ultrad\u017awi\u0119kowych (40 kHz) do pomiaru kierunku i pr\u0119dko\u015bci wiatru","Testy terenowe - pomiar pr\u0119dko\u015bci wiatru pozornego z samochodu (weryfikacja zakresu wi\u0119kszych pr\u0119dko\u015bci wiatru)","Dwuosiowy anemometr ultrad\u017awi\u0119kowy wykorzystuj\u0105cy pomiar przesuni\u0119cia fazowego.\n\nUrz\u0105dzenie mierzy pr\u0119dko\u015b\u0107 wiatru w\xa0zakresie 0-20\xa0m/s z\xa0rozdzielczo\u015bci\u0105 0,1\xa0m/s oraz dok\u0142adno\u015bci\u0105 kierunku\xa0\xb11\xb0.\n\nPROBLEM\nMechaniczne anemometry charakteryzuj\u0105 si\u0119 du\u017c\u0105 bezw\u0142adno\u015bci\u0105, nisk\u0105 czu\u0142o\u015bci\u0105 na nag\u0142e podmuchy oraz podatno\u015bci\u0105 na zu\u017cycie mechaniczne. Wymaga to d\u0142ugiego czasu u\u015bredniania i\xa0prowadzi do b\u0142\u0119d\xf3w pomiarowych. Komercyjne ultrad\u017awi\u0119kowe czujniki wiatru s\u0105 kosztowne, co ogranicza ich dost\u0119pno\u015b\u0107. Potrzebne by\u0142o tanie i\xa0wydajne rozwi\u0105zanie.\n\nROZWI\u0104ZANIE\nZaprojektowa\u0142em dwuosiowy anemometr ultrad\u017awi\u0119kowy oparty na pomiarze przesuni\u0119cia fazowego sygna\u0142\xf3w 40\xa0kHz pomi\u0119dzy nadajnikiem a\xa0odbiornikiem piezoelektrycznym. Zaimplementowa\u0142em enkoder kwadraturowy w\xa0celu rozszerzenia zakresu pomiarowego oraz system zdarze\u0144 sterowany przez DMA w\xa0mikrokontrolerze ATxmega do pr\xf3bkowania w\xa0czasie rzeczywistym. \nCz\u0119\u015b\u0107 analogowa obejmuje wzmacniacz transimpedancyjny, filtry pasmowe oraz detektor przej\u015bcia przez zero. Pomiar przesuni\u0119cia fazowego realizowany jest przez por\xf3wnanie r\xf3\u017cnicy faz sygna\u0142u nadajnika i odbiornika, mierzony przy pomocy licznika mikrokontrolera w trybie Input Capture. Oprogramowanie realizuje korekcj\u0119 pomiar\xf3w i\xa0zapis danych; wyniki s\u0105 ci\u0105gle zapisywane na kart\u0119 SD (FatFs - Generic FAT Filesystem Module).\nSystem zapewnia szybk\u0105 reakcj\u0119 na podmuchy oraz dok\u0142adny pomiar kierunku przy u\u017cyciu tanich przetwornik\xf3w piezoelektrycznych.\n\nREZULTATY\nOsi\u0105gni\u0119to zakres pomiarowy 0-20\xa0m/s z\xa0b\u0142\u0119dem <8%\xa0wzgl\u0119dem referencyjnej stacji pogodowej, rozdzielczo\u015b\u0107 kierunku 1\xb0\xa0oraz mo\u017cliwo\u015b\u0107 ci\u0105g\u0142ego zapisu danych na kart\u0119 SD.\nCzas reakcji i\xa0czu\u0142o\u015b\u0107 na podmuchy znacz\u0105co przewy\u017cszaj\u0105 typowe anemometry mechaniczne.\n\nMoja rola: pe\u0142na realizacja projektu w\xa0zakresie hardware i\xa0software.\n\nLink:\nhttps://apd.usos.pw.edu.pl/diplomas/22611/?_s=1\n\n  ","Komora termiczna z grzaniem indukcyjnym","Komora termiczna z ogrzewaniem indukcyjnym do testowania sprz\u0119tu elektronicznego (od -30 \xb0C do +120 \xb0C), wyposa\u017cona w rezonansowy p\xf3\u0142mostkowy stopie\u0144 mocy LLC, regulacj\u0119 PID i interfejs u\u017cytkownika.","Komora podczas testu niskotemperaturowego - pr\xf3bka zanurzona w oleju parafinowym, widoczne ch\u0142odz\u0105ce po bokach","Testowany uk\u0142ad elektroniczny wewn\u0105trz komory (po spuszczeniu oleju)","Modu\u0142 steruj\u0105cy: sterownik p\xf3\u0142-mostka LLC (IGBT + FAN7382N), ESP8285, STM32F103","Laboratoryjny system do kontrolowanych test\xf3w temperaturowych elektroniki (-30 \xb0C do +120 \xb0C)\n\nKompaktowa komora termiczna umo\u017cliwiaj\u0105ca realizacj\u0119 powtarzalnych przebieg\xf3w temperaturowych od -30 \xb0C do +120 \xb0C z\xa0kontrolowan\u0105 szybko\u015bci\u0105 zmian 0,5 \xb0C/min.\n\nPROBLEM\nWiele bada\u0144 laboratoryjnych i\xa0test\xf3w niezawodno\u015bci wymaga jednorodnego, stabilnego \u015brodowiska temperaturowego w\xa0szerokim zakresie temperatur. Motywacj\u0105 projektu by\u0142o stworzenie platformy testowej umo\u017cliwiaj\u0105cej generowanie powtarzalnych przebieg\xf3w temperaturowych dla elektroniki i\xa0precyzyjnych pomiar\xf3w.\n\nROZWI\u0104ZANIE\nZaprojektowa\u0142em i\xa0zbudowa\u0142em kompletn\u0105 komor\u0119 termiczn\u0105 \u0142\u0105cz\u0105c\u0105 wymian\u0119 ciep\u0142a przez zanurzenie w\xa0oleju z\xa0grzaniem indukcyjnym oraz aktywnym ch\u0142odzeniem. Badany uk\u0142ad umieszczany jest w\xa0stalowym, sze\u015bciennym zbiorniku (wyspawanym przeze mnie), wype\u0142nionym olejem parafinowym. Olej zapewnia bezpieczn\u0105 elektrycznie prac\u0119 oraz bardzo jednorodn\u0105 wymian\u0119 ciep\u0142a w\xa0ca\u0142ym zakresie temperatur.\n\nUzyskanie temperatur ujemnych zrealizowano przy u\u017cyciu przeno\u015bnej elektrycznej zamra\u017carki do rur. Do zbiornika dospawano dedykowane uchwyty umo\u017cliwiaj\u0105ce bezpo\u015brednie mocowanie uchwyt\xf3w ch\u0142odz\u0105cych, co zapewnia efektywne odprowadzanie ciep\u0142a przez \u015bcianki naczynia i\xa0stabilne ch\u0142odzenie do -30 \xb0C.\n\nNagrzewanie realizowane jest indukcyjnie - stalowy zbiornik pe\u0142ni rol\u0119 elementu grzejnego, w\xa0kt\xf3rym indukowane s\u0105 pr\u0105dy wirowe. Energia przekazywana jest z\xa0cewki pochodz\u0105cej z\xa0pola grzejnego kuchenki indukcyjnej i\xa0r\xf3wnomiernie rozprowadzana do oleju oraz badanego uk\u0142adu.\n\nCewka zasilana jest przez rezonansow\u0105 przetwornic\u0119 p\xf3\u0142-mostkow\u0105 LLC z\xa0tranzystorami IGBT (FGHL40T65MQDT). Regulacja mocy odbywa si\u0119 poprzez zmian\u0119 cz\u0119stotliwo\u015bci pracy wzgl\u0119dem punktu rezonansowego, z\xa0zachowaniem pracy w trybie ZVS. Tranzystory sterowane s\u0105 przez uk\u0142ad FAN7382N z\xa0kontrolowanym czasem martwym.\n\nSterowanie systemem, generacja PWM oraz regulacja temperatury zosta\u0142y zaimplementowane na mikrokontrolerze STM32F103. Pomiar temperatury realizuj\u0105 czujniki DS18B20, a\xa0regulator PID umo\u017cliwia realizacj\u0119 liniowych ramp temperaturowych. Prosty interfejs WWW uruchomiony na ESP8285 pozwala na r\u0119czne sterowanie, a\xa0system mo\u017ce by\u0107 r\xf3wnie\u017c w\xa0pe\u0142ni automatyzowany z\xa0u\u017cyciem skrypt\xf3w Python.\n\nZabezpieczenia realizowane s\u0105 przez polimerowe bezpieczniki nadpr\u0105dowe oraz bezpiecznik termiczny BF121, kt\xf3ry odcina zasilanie przy temperaturach powy\u017cej 121\xa0\xb0C.\n\nKomora zosta\u0142a wykorzystana m.in. do bada\u0144 temperaturowych rezonator\xf3w kwarcowych i\xa0analizy stabilno\u015bci cz\u0119stotliwo\u015bci.\n\nREZULTATY\nProjekt systemu obejmowa\u0142: mechanik\u0119, elektronik\u0119 mocy, firmware, algorytmy sterowania, interfejs u\u017cytkownika, automatyzacj\u0119 i\xa0walidacj\u0119.\n- Zakres temperatur: -30 \xb0C do +120 \xb0C\n- Szybko\u015b\u0107 zmian temperatury: 0,5 \xb0C/min\n- Pe\u0142ny cykl -30 \xb0C do +120 \xb0C: ~5 godzin\n- Maksymalne zu\u017cycie mocy: ~50 W\n  ","Rozproszona sie\u0107 czujnik\xf3w sejsmicznych i infrad\u017awi\u0119kowych","Rozw\xf3j i wdro\u017cenie sieci czujnik\xf3w sejsmicznych i infrad\u017awi\u0119kowych monitoruj\u0105cych szum \u015brodowiskowy w detektorach fal grawitacyjnych. Instalacje w trzech mi\u0119dzynarodowych o\u015brodkach.","Instalacja mikrofonu infrad\u017awi\u0119kowego w ETpathfinder (Maastricht University).","Monta\u017c infrad\u017awi\u0119kowego czujnika w kopalni Sos Enattos (Sardynia) - potencjalna lokalizacja ET.","Instalacja czujnik\xf3w w Virgo (EGO, W\u0142ochy) - mikrofony infrad\u017awi\u0119kowe na statywach i czujniki sejsmiczne (\u017c\xf3\u0142te urz\u0105dzenia pod statywami).","Monitorowanie szumu newtonowskiego w detektorach fal grawitacyjnych\n\nRozproszona sie\u0107 czujnik\xf3w sejsmicznych i\xa0infrad\u017awi\u0119kowych monitoruj\u0105ca szum \u015brodowiskowy w\xa0detektorach fal grawitacyjnych w\xa0trzech mi\u0119dzynarodowych lokalizacjach badawczych.\n\nPROBLEM\nSzum newtonowski - wibracje sejsmiczne i\xa0zmiany ci\u015bnienia w\xa0zakresie niskich cz\u0119stotliwo\u015bci d\u017awi\u0119ku - ogranicza czu\u0142o\u015b\u0107 detektor\xf3w fal grawitacyjnych takich jak Virgo i\xa0planowany Einstein Telescope. Zrozumienie i\xa0charakteryzacja tego szumu \u015brodowiskowego jest kluczowa dla poprawy dzia\u0142ania detektor\xf3w i\xa0umo\u017cliwienia detekcji jeszcze s\u0142abszych sygna\u0142\xf3w fal grawitacyjnych pochodz\u0105cych z\xa0odleg\u0142ych zjawisk kosmicznych.\n\nROZWI\u0104ZANIE\nW ramach zespo\u0142u badawczego kierowanego przez dr. Mariusza Suchenka w AstroCeNT (Centrum Astronomiczne im. Miko\u0142aja Kopernika PAN), bra\u0142em udzia\u0142 w tworzeniu i\xa0wdra\u017caniu sieci czujnik\xf3w sejsmicznych i\xa0infrad\u017awi\u0119kowych opracowanych w\xa0instytucie. Moje obowi\u0105zki obejmowa\u0142y monta\u017c dedykowanych p\u0142ytek PCB, testowanie prototyp\xf3w czujnik\xf3w w\xa0warunkach laboratoryjnych oraz udzia\u0142 w instalacjach terenowych w\xa0o\u015brodkach badawczych. Sie\u0107 sk\u0142ada si\u0119 z\xa0precyzyjnych czujnik\xf3w sejsmicznych monitoruj\u0105cych drgania gruntu oraz mikrofon\xf3w infrad\u017awi\u0119kowych mierz\u0105cych zmiany ci\u015bnienia od niskich cz\u0119stotliwo\u015bci. Razem zainstalowali\u015bmy ponad 100 par czujnik\xf3w. Wyje\u017cd\u017ca\u0142em do mi\u0119dzynarodowych o\u015brodk\xf3w badawczych, aby wspiera\u0107 instalacj\u0119 czujnik\xf3w i\xa0integracj\u0119 system\xf3w, zdobywaj\u0105c do\u015bwiadczenie w\xa0wielonarodowych wsp\xf3\u0142pracach naukowych.\n\nMikrofony infrad\u017awi\u0119kowe - kluczowe parametry\n- Zakres cz\u0119stotliwo\u015bci: 0,1-120 Hz\n- Czu\u0142o\u015b\u0107: 2,5 mV/Pa\n- Nieliniowo\u015b\u0107 (zniekszta\u0142cenia): < 1,5 dB\n- Koszt jednostkowy: ~100 EUR\n\nSejsmometry - kluczowe parametry\n- Zakres dynamiki: 134 dB\n- Dok\u0142adno\u015b\u0107 synchronizacji czasu: < 20 \xb5s\n- Cz\u0119stotliwo\u015b\u0107 pr\xf3bkowania: od 0,5 ms\n\nREZULTATY\nSieci czujnik\xf3w pomy\u015blnie wdro\u017cone i\xa0dzia\u0142aj\u0105ce w\xa0trzech kluczowych lokalizacjach: detektor fal grawitacyjnych Virgo EGO (Cascina, W\u0142ochy), podziemny o\u015brodek badawczy Sos Enattos (Sardynia, W\u0142ochy) oraz laboratorium rozwoju technologii ET Path Finder (Maastricht, Holandia). Dane zbierane z\xa0tych instalacji s\u0105 analizowane przez zespo\u0142y badawcze w\xa0celu opracowania strategii redukcji szumu dla detektor\xf3w nowej generacji. Dla technologii czujnik\xf3w opracowanej przez grup\u0119 z\u0142o\u017cono wnioski patentowe.\n\nMoja rola: Specjalista-technik i\xa0doktorant - monta\u017c PCB, testy prototyp\xf3w czujnik\xf3w, instalacje terenowe w\xa0mi\u0119dzynarodowych o\u015brodkach, wsparcie techniczne dla wsp\xf3\u0142prac wielonarodowych.\n\nLinki (Publikacje):\n\nhttps://doi.org/10.1140/epjp/s13360-023-04834-0\n\nhttps://indico.ego-gw.it/event/562/contributions/5213/attachments/2731/4824/2023_MSuchenek.pdf\n\nhttps://doi.org/10.22323/1.441.0104 \n\n  "],t.li)
